import React from 'react'
import { selectAllCoupons, useGetCouponsQuery } from '../api/couponsSlice'
import { useSelector } from "react-redux"
import {Coupon} from './Coupon.js'

export const CouponsList = () => {
  // const coupons = useSelector(selectAllCoupons)
  const { data:coupons, isLoading, isSuccess} = useGetCouponsQuery('getCoupons')

  let couponsList;
  if (isSuccess) {
    couponsList = coupons.ids.map(id => (
          <li key={id} value={id}>
              {coupons.entities[id].name}
              {coupons.entities[id].code}
          </li>
      ))
  }

  return (
    <ul>{couponsList}</ul>
  )
}
